We start by calculating the two ratios using the ending values provided in the balance sheet.

1. Current Ratio = Total Current Assets / Total Current Liabilities  
  = 9,982,261.98 / 499,821.72  
  ≈ 19.96

2. Inventory Turnover Ratio = Cost of Goods Sold / Average Inventory  
For this statement, the Inventory value is 0. (Both the beginning and ending inventory are 0.) Since Average Inventory = (Beginning Inventory + Ending Inventory) / 2 = 0, the ratio would involve division by zero. This means that the Inventory Turnover Ratio is undefined (or can be interpreted as infinite).

Thus, the solution is:

